import React from 'react';

function Home(props) {
    if(props.home.isLoading)
    {
        return(
            <div className="container">
                LOADING...
            </div>
        );
    }
    else if(props.home.errmsg) {
        return(
            <div className="container">
                <div className="row">
                    <h4>{props.home.errmsg}</h4>
                </div>
            </div>
        );
    } 
    else if(props.home.home)   {
        return(
            <div className="container">
                HOME
            </div>
        );
    }
    else {
        return(
            <div></div>
        );
    }
    
}

export default Home;
